import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { Button, Container, Row, Col, Card } from 'react-bootstrap';

function DetailScreening() {
  const location = useLocation();
  const navigate = useNavigate();
  const item = location.state?.item;

  if (!item) {
    return (
      <Container className="mt-5 text-center">
        <h4>Data screening tidak ditemukan.</h4>
        <Button onClick={() => navigate('/riwayat')} variant="secondary" className="mt-3">
          Kembali ke Riwayat
        </Button>
      </Container>
    );
  }

  const pertanyaanKeys = Object.keys(item?.jawaban || item?.gejala || {});
  const jawabanArray = (() => {
    if (Array.isArray(item?.jawaban)) return item.jawaban;
    if (typeof item?.jawaban === 'string') {
      try {
        const parsed = JSON.parse(item.jawaban);
        return Array.isArray(parsed) ? parsed : Object.values(parsed);
      } catch {
        return [];
      }
    }
    if (typeof item?.jawaban === 'object' && item.jawaban !== null) {
      return Object.values(item.jawaban);
    }
    if (typeof item?.gejala === 'object' && item.gejala !== null) {
      return Object.values(item.gejala);
    }
    return [];
  })();

  const tanggalFormat = new Date(item.tanggal_screening).toLocaleDateString('id-ID', {
    day: 'numeric', month: 'long', year: 'numeric'
  });

  return (
    <Container className="mt-5">
      <Card className="shadow p-4">
        <h4 className="mb-4">📝 Detail Screening</h4>
        <Row className="mb-3">
          <Col><strong>👤 Nama:</strong> {item.nama_pasien}</Col>
          <Col><strong>📅 Tanggal:</strong> {tanggalFormat}</Col>
        </Row>
        <Row className="mb-3">
          <Col><strong>📈 Probabilitas:</strong> {(item.probabilitas * 100).toFixed(2)}%</Col>
          <Col><strong>⚠️ Hasil:</strong> {item.hasil}</Col>
        </Row>

        <hr />

        <h5 className="mt-4">📋 Jawaban Screening:</h5>
        {jawabanArray.map((jawaban, index) => {
          const pertanyaan = pertanyaanKeys[index]?.replace(/_/g, ' ') || `Pertanyaan ${index + 1}`;
          const jawabanTeks = jawaban === 1 ? 'Ya' : jawaban === 0 ? 'Tidak' : jawaban;

          return (
            <div key={index} className="mb-2">
              <strong>{index + 1}. {pertanyaan}</strong>
              <br />
              Jawaban: <span className="text-primary">{jawabanTeks}</span>
            </div>
          );
        })}

        <div className="text-center mt-4">
          <Button variant="secondary" onClick={() => navigate('/riwayat')}>⬅️ Kembali ke Riwayat</Button>
        </div>
      </Card>
    </Container>
  );
}

export default DetailScreening;
